import React from 'react'

const Ability = ({ ability }) => {
    let ability_style = `background-image:${ability.icon}`
    return (
        <div>
            <div className="ability_icon" style={ability_style}>
                <div className="ability_name_box">{ability.name}</div>
            </div>
        </div>
    )
}

export default Ability
